import React, { useState } from "react";
import axios from "axios";

const SalaryPredictor = () => {
  const [formData, setFormData] = useState({
    YearsCodePro: "",
    OrgSize: "",
    WorkExp: "",
    NumberOfDatabasesKnown: "",
    NumberOfPlatformsKnown: "",
    Remote: false,
    Developer: false,
  });

  const [result, setResult] = useState(null);
  const [error, setError] = useState("");

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    try {
      const response = await axios.post("http://localhost:5000/api/predict", formData);
      setResult(response.data.predictedSalary);
    } catch (err) {
      setError("Prediction failed. Try again.");
    }
  };

  return (
    <div className="p-4 max-w-lg mx-auto">
      <h2 className="text-xl font-bold mb-4">Salary Predictor</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        {[
          { name: "YearsCodePro", type: "number" },
          { name: "WorkExp", type: "number" },
          { name: "NumberOfDatabasesKnown", type: "number" },
          { name: "NumberOfPlatformsKnown", type: "number" },
        ].map((field) => (
          <div key={field.name}>
            <label className="block">{field.name}</label>
            <input
              type={field.type}
              name={field.name}
              value={formData[field.name]}
              onChange={handleChange}
              className="border px-2 py-1 w-full"
              required
            />
          </div>
        ))}

        <div>
          <label className="block">OrgSize</label>
          <select
            name="OrgSize"
            value={formData.OrgSize}
            onChange={handleChange}
            className="border px-2 py-1 w-full"
            required
          >
            <option value="">Select</option>
            <option value="1-10">1-10</option>
            <option value="10-100">10-100</option>
            <option value="100-500">100-500</option>
            <option value="500-1000">500-1000</option>
            <option value="1000+">1000+</option>
          </select>
        </div>

        <div className="flex items-center gap-2">
          <label>Remote</label>
          <input
            type="checkbox"
            name="Remote"
            checked={formData.Remote}
            onChange={handleChange}
          />
        </div>

        <div className="flex items-center gap-2">
          <label>Developer</label>
          <input
            type="checkbox"
            name="Developer"
            checked={formData.Developer}
            onChange={handleChange}
          />
        </div>

        <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">
          Predict Salary
        </button>
      </form>

      {result && (
        <div className="mt-4 p-4 bg-green-100 text-green-800 rounded">
          üí∞ Predicted Salary: <strong>${result} USD</strong>
        </div>
      )}

      {error && (
        <div className="mt-4 p-4 bg-red-100 text-red-800 rounded">
          ‚ùå {error}
        </div>
      )}
    </div>
  );
};

export default SalaryPredictor;
